
/*

alter table zz_import_20101010_patient add PID int

update zz_import_20101010_patient
set Pid=null

update z
set Pid = rowId
FROM zz_import_20101010_patient z
	inner join (
				select F1, F2, rowId = row_number() over( order by F1)
				from zz_import_20101010_patient
				where f2 like 'H%'
				) as v
		on v.F1=z.F1





update p
set Pid=v.Pid
FROM (
		select z.pid, z.F1 as F1min, zz.F1 as F1max
		from zz_import_20101010_patient z
			inner join zz_import_20101010_patient zz
				on z.pid=zz.pid-1
	) as v
	inner join zz_import_20101010_patient p
		on p.F1 > v.F1min and p.F1 < v.f1Max
where p.pid is null



update zz_import_20101010_patient
set Pid = 4184
where f1 in (20507, 20506)


alter table zz_import_20101010_patient add recordType char(1)

update zz_import_20101010_patient
set recordType='P'
where F2 like 'H%'


update zz_import_20101010_patient
set recordType='I'
where F2 not like 'H%'



select * 
from zz_import_20101010_patient
where recordType='P'


-- clean up SSN 
update zz_import_20101010_patient
set F11=null
where recordType='P'
	and F11 = 0
	
alter table zz_import_20101010_patient add [state] varchar(50)
alter table zz_import_20101010_patient add Zip varchar(50)
alter table zz_import_20101010_patient add City varchar(50)
alter table zz_import_20101010_patient add Address1 varchar(128)
alter table zz_import_20101010_patient add tempAddress varchar(500)


update zz_import_20101010_patient
set tempAddress = f13
where recordType='P'


	


update z
set state= ltrim( rtrim((substring(tempAddress, charindex(', ', tempAddress)+2, 2000) ) ))
from zz_import_20101010_patient z
where recordType='P'



update z
set zip= ltrim( rtrim((substring(state, charindex(' ', state)+1, 2000) ) ))
from zz_import_20101010_patient z
where recordType='P'


update z
set state= left(state, charindex(' ', state))
from zz_import_20101010_patient z
where recordType='P'




update z
set tempAddress= left(tempAddress, charindex(', ' + state, tempAddress))
from zz_import_20101010_patient z
where recordType='P'


update z
set tempAddress= left(tempAddress, len(tempAddress)-1)
from zz_import_20101010_patient z
where recordType='P'


update z
set tempAddress= ltrim(rtrim(tempAddress))
from zz_import_20101010_patient z
where recordType='P'



update z
set city = replace( rtrim(ltrim(right(tempAddress, charindex( char(10),  reverse(tempAddress))))), char(10), '')
from zz_import_20101010_patient z
where recordType='P'


update z
set Address1 = ltrim(rtrim( left(tempAddress, charindex( char(10), tempAddress ) -1 )))
from zz_import_20101010_patient z
where recordType='P'
	and charindex( char(10), tempAddress ) > 0
	

alter table zz_import_20101010_patient add fName varchar(50)
alter table zz_import_20101010_patient add lName varchar(50)
alter table zz_import_20101010_patient add mName varchar(50)
alter table zz_import_20101010_patient add tempName varchar(50)

update zz_import_20101010_patient
set tempName = F3

update z
set lName = left(tempName, charindex(',', tempName)-1)
from zz_import_20101010_patient z
where recordType='P'


update z
set tempName =  substring(tempName, charindex(',', tempName)+2, 2000)
from zz_import_20101010_patient z
where recordType='P'


update z
set tempName = ltrim(rtrim(tempName))
from zz_import_20101010_patient z
where recordType='P'

update z
set mName= ltrim(rtrim(case when charindex(' ', reverse(tempName))=2 then left(reverse(tempName), 1) else null end ))
from zz_import_20101010_patient z
where recordType='P'


update z
set fName = case when charindex(' ', reverse(tempName))=2 then left(tempName, len(tempName) - 2) else tempName end
from zz_import_20101010_patient z
where recordType='P'


select F3, tempName, fName, lName, mName 
from zz_import_20101010_patient z
where recordType='P'
	
insert into vendorImport( VendorName, VendorFormat, DateCreated, Notes)
values( 'Custom', 'xls', getdate(), 'sf 146253')


INSERT INTO dbo.zz_import_20101010_insurance( [Payer Name] )
SELECT distinct F3 from zz_import_20101010_patient z
where not exists(select * from zz_import_20101010_insurance where [Payer Name]=z.F3 )
	and recordType='I'



