declare @practiceID int, @vendorImportID int
select @practiceID=1, @vendorImportID=1



	INSERT INTO [dbo].[Patient](
		prefix,
		Suffix,
		MiddleName,
		[PracticeID],
		[FirstName],
		[LastName],
		[AddressLine1],
		[AddressLine2],
		[City],
		[State],
		[ZipCode],
		[HomePhone],
		WorkPhone,
		WorkPhoneExt,
		MobilePhone,
		[DOB],
		SSN,
		[Gender],
		[VendorID],
		MedicalRecordNumber,
		VendorImportID,
		CollectionCategoryID,
		DefaultServiceLocationID,
		PrimaryProviderID,
		EmailAddress,
		EmploymentStatus,
		EmployerID,
		MaritalStatus
			
		,ResponsibleFirstName,
		ResponsibleMiddleName,
		ResponsibleLastName,
		ResponsibleAddressLine1,
		ResponsibleCity,
		ResponsibleState,
		ResponsibleZipCode
		)

	SELECT 
		'' prefix,
		left( '', 16) as suffix,
		left(isnull( mName, ''), 64) as MI,
		@practiceID as practiceID,
		isnull( left(fName, 64) , ''),
		isnull( left(LName, 64) , ''),
		isnull( left( Address1, 256), ''),
		isnull( left( null, 256), '') as addr2,
		left( isnull([City], ''), 128) ,
		case when len( ltrim(rtrim([State])) )=2 then ltrim(rtrim([State])) else '' end,
		left(replace( Zip,'-', ''), 9) as zip,
		case when len(F9)<=10 then F9 else null end HomePhone,
		cast( replace(replace(replace(replace( F5, '-', ''), ')', ''), '(', ''), ' ', '')  as varchar(max) ) WorkPhone,
		null workExt,
		null as MobilePhone, 
		cast( case when isdate(F7)=1 then F7 else null end as datetime),
		case when len(replace(F11, '-', ''))=9 then replace( F11, '-', '') else null end as SSN,
		case F17
			when 'M' then 'M'
			when 'F' then 'F'
			else null end,  
		rowid as [VendorID], -- vendorID
		left( nullif( F2, ''), 128)  as  MRN,
		@vendorImportID, -- vendorImportID
		1,
		null as serviceLocationID,
		null as primaryProviderID,
		left( null, 256) as Email,
		null as EmploymentStatus,
		null EmployerID,
		null as MaritalStatus
		
		,isnull( null, '') as ResponsibleFirstName,
		null as ResponsibleMiddleName,
		isnull( null, '') as ResponsibleLastName,
		left( isnull( null, ''), 256) as ResponsibleAddressLine1,
		isnull( null, '') as ResponsibleCity,
		rtrim(ltrim( isnull( null, '') )) as ResponsibleState,
		isnull( left(replace(  null,'-', ''), 9), '') as ResponsibleZipCode
	from dbo.zz_import_20101010_patient i
	where not exists(select * from patient p where p.vendorID=i.rowID and p.vendorImportID=@vendorImportID)
		and recordType='P'


update z
set patientId=p.patientId
from zz_import_20101016_patient z
	inner join patient p
		on p.vendorId=z.rowID



update p
set ResponsibleFirstName = FinancialResponsibility_First,
	ResponsibleLastName = PatientResponsibility_Last
from zz_import_20101016_patient z
	inner join patient p
		on p.vendorId=z.rowID
where vendorImportId=1




