update insuranceCompany
set VendorImportId=1
where cast(notes as varchar(max))='Kareo import on 10/10/2010'



alter table zz_import_20101010_patient add insuranceCompanyId int
alter table zz_import_20101010_patient add insuranceCompanyPlanId int



update z
set insuranceCompanyId = ic.insuranceCompanyId
from zz_import_20101010_patient z
	inner join insuranceCompany ic
		on ic.insuranceCompanyName=z.F3
where recordType='I'
	and ic.vendorImportId=1






alter table zz_import_20101010_patient add PlanTypeCode char(2)

update z
set PlanTypeCode = v.PlanTypeCode
FROM zz_import_20101010_patient z
	inner join (
				select 'BL' PlanTypeCode, 'Blue Cross' as PlanType union all
				select 'BL', 'Blue Cross/Blue Shield' union all
				select 'CH', 'Champus' union all
				select 'CI', 'Commercial insurance company' union all
				select 'OF', 'Federal Employee`s Program (FEP)' union all
				select 'HM', 'HMO' union all
				select 'MC', 'Medicaid' union all
				select 'MC', 'Medicare' union all
				select '11', 'Other' union all
				select 'OF', 'Other Federal Program' union all
				select '9', 'Self Administered' union all
				select '9', 'Self Pay' union all
				select 'VA', 'Veteran Administration Plan' union all
				select 'WC', 'Worker''s compensation'
				) as v
		on v.PlanType=z.F19

	


