update z
set insuranceCompanyPlanId=icp.insuranceCompanyPlanId
FROM zz_import_20101010_patient z
	inner join insuranceCompanyPlan icp
		on icp.planName=z.F21
		
		


		

	---- delete [PatientCase] where vendorImportID=1
	-- Primary
	INSERT INTO [PatientCase]
		([PatientID]
		,[Name]
		,[Active]
		,[PayerScenarioID] -- select * from payerScenario
		,[CreatedUserID]
		,[ModifiedUserID]
		,[PracticeID]
		,VendorImportID
		,VendorID
		   )
	select
		patientID,	
		'Default Insurance Case',
		1,
		5,
		951,
		951,
		practiceID,
		VendorImportID,
		p.vendorID
	from Patient p
	where p.VendorImportID = @vendorImportId
		and vendorId in ( select p.rowId from dbo.zz_import_20101010_patient i inner join zz_import_20101010_patient p on p.pid=i.pid where i.InsuranceCompanyPlanId is not null)

		


insert into dbo.InsurancePolicy(
	PatientCaseID
	,InsuranceCompanyPlanID
	,Precedence
	,PolicyNumber
	,GroupNumber

	,CardOnFile
	,PatientRelationshipToInsured
	,HolderThroughEmployer
	,PatientInsuranceStatusID
	,VendorID
	,VendorImportID
	,PracticeID
	,CoPay
)
select 
	pc.PatientCaseID
	,z.InsuranceCompanyPlanId
	,row_number() over(partition by z.pid order by z.F2)
	,z.F8 as Policy
	,null as [Group]
	,0 as CardOnFile
	,'S' as PatientRelationshipToInsured
	,0 as HolderThroughEmployer
	,0 as PatientInsuranceStatusID
	,z.rowID as VendorID
	,p.vendorImportId as VendorImportID
	,p.PracticeID
	, case when isnumeric(z.f5)=1 then z.f5 else null end as copay
from Patient p
	inner join dbo.zz_import_20101010_patient i
		on i.rowId=p.vendorId
		and i.recordType='P'
	inner join dbo.zz_import_20101010_patient z
		on i.pid=z.pid
		and z.recordType='I'
	inner join PatientCase pc (nolock)
		on pc.patientID=p.patientID
where p.vendorImportID=@vendorImportId
	and z.InsuranceCompanyPlanId is not null
order by 1, 3




