INSERT INTO [dbo].[Doctor]
           ([PracticeID]
           ,[Prefix]
           ,[FirstName]
           ,[MiddleName]
           ,[LastName]
           ,[Suffix]
           ,[SSN]
           ,[AddressLine1]
           ,[AddressLine2]
           ,[City]
           ,[State]
           ,[Country]
           ,[ZipCode]
           ,[Notes]
           ,[ActiveDoctor]
           ,[TaxonomyCode]
           ,[DepartmentID]
           ,[VendorID]
           ,[VendorImportID]
           ,[FaxNumber]
           ,[FaxNumberExt]
           ,[OrigReferringPhysicianID]
           ,[External]
           ,[NPI]
           ,[ProviderTypeID]
           ,[ProviderPerformanceReportActive]
           ,[ProviderPerformanceScope]
           ,[ProviderPerformanceFrequency]
           ,[ProviderPerformanceDelay]
           ,[ProviderPerformanceCarbonCopyEmailRecipients]
           ,Degree
           ,WorkPhone
     )
     
select
			1 as [PracticeID]
           ,'' as [Prefix]
           ,left([first Name], 64) as FirstName
           , left( isnull(middle, ''), 64) as [MiddleName]
           ,left( rtrim(ltrim(isnull(lastName,[last]) )), 64) as [LastName]
           ,'' as [Suffix]
           ,null as ssn
           ,left(address, 256) as [AddressLine1]
           ,'' as [AddressLine2]
           ,left(city, 128) as [City]
           ,left( state, 2) as [State]
           ,'' as [Country]
           ,zip as [ZipCode]
           ,'Imported by Kareo 10/10/2010' as [Notes]
           ,1 as [ActiveDoctor]
           ,'0000000001' as [TaxonomyCode]
           ,null [DepartmentID]
           ,rowID as [VendorID]
           ,@vendorImportId as [VendorImportID]
           ,null [FaxNumber]
           ,null [FaxNumberExt]
           ,null [OrigReferringPhysicianID]
           ,1 as [External]
           ,null as [NPI]
           ,1 as [ProviderTypeID]
           ,1 as [ProviderPerformanceReportActive]
           ,1 as [ProviderPerformanceScope]
           ,'D' [ProviderPerformanceFrequency]
           ,2 [ProviderPerformanceDelay]
           ,null [ProviderPerformanceCarbonCopyEmailRecipients]
           ,ltrim(rtrim( LEFT(degree, 8) ))
           ,case when len( convert(varchar(20), cast(phone as bigint) ) ) <= 10 then convert(varchar(10), cast(phone as bigint) ) else null end as WorkPhone
from zz_import_20101010_referringProvider z
where not exists( select * from doctor d where d.vendorID=z.rowID and d.vendorImportID=@vendorImportId)









