update z
set PlanTypeCode = v.PlanTypeCode
FROM zz_import_20101010_insurance z
	inner join (
				select 'BL' PlanTypeCode, 'Blue Cross' as PlanType union all
				select 'BL', 'BLUEX-SHIELD' union all
				select 'CH', 'Champus' union all
				select 'CI', 'COMMERCIAL INSURANCE' union all
				select 'OF', 'Federal Employee`s Program (FEP)' union all
				select 'HM', 'HMO' union all
				select 'MC', 'MEDICAID' union all
				select 'MC', 'MEDICARE' union all
				select '11', 'Other' union all
				select 'OF', 'Other Federal Program' union all
				select '9', 'Self Administered' union all
				select '9', 'Self Pay' union all
				select 'VA', 'Veteran Administration Plan' union all
				select 'WC', 'Worker''s compensation'
				) as v
		on v.PlanType=z.[Group Type]
		
		
		
		

