update insuranceCompany
set vendorId= replace( cast(notes as varchar(max)), 'Imported 10/15/2010, rowId:', '')
	, vendorImportId=2
	, notes = 'Kareo import on 10/15/2010
 Group No# ' + [Payer ID / Group No#]
where notes like 'Imported 10/15/2010, rowId:%'


update ic
set notes = 'Kareo import on 10/15/2010 
Group No# ' + isnull([Payer ID / Group No#], '')
from insuranceCompany ic
	inner join zz_import_20101010_insurance z
		on z.rowId=ic.vendorId
where vendorImportId=2


